var slideout = new Slideout({
	'panel': document.getElementById('mainpanel'),
	'menu': document.getElementById('slidemenu'),
	'touch': false,
	'padding': 256,
	'tolerance': 70
});

slideout.once('open', slideout._initTouchEvents);
slideout.on('open', slideout.enableTouch);
slideout.on('close', slideout.disableTouch);

document.querySelector('.toggle-button').addEventListener('click', function() {
	slideout.toggle();
	if(scrollingRightNow)
		toggleScrolling();
});

var fixed = document.querySelector('.fixed-header');

slideout.on('translate', function(translated) {
	fixed.style.transform = 'translateX(' + translated + 'px)';
});

slideout.on('beforeopen', function () {
	fixed.style.transition = 'transform 300ms ease';
	fixed.style.transform = 'translateX(256px)';
});

slideout.on('beforeclose', function () {
	fixed.style.transition = 'transform 300ms ease';
	fixed.style.transform = 'translateX(0px)';
});

slideout.on('open', function () {
	fixed.style.transition = '';
});

slideout.on('close', function () {
	fixed.style.transition = '';
});

//for overlay
function close(eve) {
	eve.preventDefault();
	slideout.close();
}
