function shareableClicked(){
	var position = $(this).offset();
	var width = $(this).width()/2;

	var baseHref = $('a.buttonTwitter').attr('data-href');
	var href= baseHref + "&text=" + $(this).text().replace(/ /g, "%20");
	$('a.buttonTwitter').attr('href',href);

	$('div.highlightMenu').css({
		position: "absolute",
		top: (position.top - 60) + "px",
		left: (position.left + width) + "px"
	});
	$('div.highlightMenu').addClass('highlightMenu--active');
}

$(document).on('click', function (e) {
	if(!$(e.target).is('span.shareable')) {
		$('div.highlightMenu').removeClass('highlightMenu--active');
	}
});


