window.onload = function () {
	$('.nav-drawer').removeClass('hidden');
};


/*menu scroll button*/
var scrollingRightNow = false;
document.querySelector('.menu-button-scroll').addEventListener('click', function() {
	toggleScrolling();
});

function toggleScrolling(){
	if(scrollingRightNow){
		$('.menu-scroll-button-play').removeClass('hidden');
		$('.menu-scroll-button-stop').addClass('hidden');
	}
	else{
		$('.menu-scroll-button-play').addClass('hidden');
		$('.menu-scroll-button-stop').removeClass('hidden');
	}
	scrollingRightNow = !scrollingRightNow;
	if(scrollingRightNow)
		pageScroll();
}

function pageScroll() {
	if(getScrollPercent()>93){
		toggleScrolling();
		return;
	}

	if(!scrollingRightNow) return;
	window.scrollBy(0,1);
	scrolldelay = setTimeout(pageScroll,75);
}

function getScrollPercent() {
	var h = document.documentElement, 
	b = document.body,
	st = 'scrollTop',
	sh = 'scrollHeight';
	return (h[st]||b[st]) / ((h[sh]||b[sh]) - h.clientHeight) * 100;
}
